        if m in memo:
            return memo[m]
        if m == 1:
            return 3
        if m % 2 == 0:
            memo[m] = 1 + m / 2
        else:
            memo[m] = helper(m - 1, memo) + helper(m - 2, memo) + helper(m + 1, memo)
        return memo[m]

    memo = {}
    result = []
    for i in range(1, n + 2):
        if i not in memo:
            helper(i, memo)
        result.append(memo[i])
    return result[:n + 1]

